  const [lang, setLang] = useState<"ko" | "en">(
    (localStorage.getItem("lang") as "ko" | "en") || "ko"
  );

  const toggleLanguage = () => {
    const newLang = lang === "ko" ? "en" : "ko"; // 현재 언어 반대
    i18n.changeLanguage(newLang);
    setLang(newLang);
    localStorage.setItem("lang", newLang); // ✅ 로컬스토리지에 저장
  };

